// --------------------------------------- Project List
export const ProjectList = [
  {
    img: "images/asianfoodblog.jpeg",
    title: "Vietnamese Food",
    description: "In general, northern Vietnamese cuisine is not bold in any particular taste—sweet, salty, spicy, bitter, or sour. Most northern Vietnamese foods feature light and balanced flavors that result from subtle combinations of many different flavoring ingredients.",
    demo_url: "/UserPage",
  },
  {
    img: "images/indianfoodblog.jpg",
    title: "Indian Food",
    description:
      "Spicy, rich, flavourful and diverse are terms that are frequently used to describe Indian food. All these words are apt in describing Indian cuisine, for it is diverse in variety and taste, and is made up from a wide array of regional cuisines throughout various parts of India.",
    demo_url: "/UserPage",
  },
  {
    img: "images/pizzablog.jpeg",
    title: "Italian Food",
    description: "Italian cuisine is a Mediterranean cuisine consisting of the ingredients, recipes and cooking techniques developed across the Italian Peninsula since antiquity, and later spread around the world together with waves of Italian diaspora.",
    demo_url: "/UserPage",
  },
  {
    img: "images/wokblog.jpg",
    title: "Chinese Food",
    description:
      "Chinese food, rich and colorful, has diversified color, aromatic flavor, and excellent taste as its main features. With these three characteristics, it is not only tasty but also a work of art for people to appreciate.",
    demo_url: "/UserPage",
  },
];
